
/*Table structure for table `operaterecord` */

DROP TABLE IF EXISTS `operaterecord`;

CREATE TABLE `operaterecord` (
  `id` varchar(32) NOT NULL,
  `createTime` datetime DEFAULT NULL,
  `isDeleted` tinyint(1) NOT NULL,
  `lastModifyTime` datetime DEFAULT NULL,
  `version` bigint(20) NOT NULL,
  `actionCruf` tinyint(4) NOT NULL COMMENT 'curf\n',
  `actionLength` int(11) NOT NULL COMMENT '具体数据结构的长度',
  `category` tinyint(4) NOT NULL COMMENT 'eg：操作指令 0x00b2->0x00',
  `dataLength` int(11) NOT NULL,
  `fromHost` varchar(255) DEFAULT NULL,
  `isSynced` varchar(255) DEFAULT NULL,
  `linkAction` int(11) NOT NULL,
  `linkHeader` tinyint(4) NOT NULL,
  `linkLf` tinyint(4) NOT NULL,
  `machineId` varchar(32) DEFAULT NULL COMMENT '生产编码',
  `playLoad` blob,
  `playLoadStr` varchar(2000) DEFAULT NULL,
  `productCode` int(11) NOT NULL COMMENT '产品型号',
  `protocolVersion` int(11) DEFAULT NULL COMMENT '协议版本',
  `resource` tinyint(4) NOT NULL COMMENT 'eg：操作指令 0x00b2->0xb2\n和category对应组成一个指令',
  `toHost` varchar(255) DEFAULT NULL,
  `uid` varchar(32) DEFAULT NULL,
  `appLoginType` varchar(255) DEFAULT NULL,
  `deviceLoginType` varchar(255) DEFAULT NULL,
  `originCode` varchar(2000) DEFAULT NULL COMMENT '原始数据的16进制窜，但不一定正确',
  `channelOpenTime` datetime DEFAULT NULL,
  `lastDecodeTime` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


